/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div	class="ui5-tli-root"	dir="${ifDefined(context.rtl)}"><div class="ui5-tli-indicator">		${ context.icon ? block1(context) : undefined }</div><div class="ui5-tli-bubble" tabindex="${ifDefined(context._tabIndex)}" role="option" data-sap-focus-ref><div class="ui5-tli-title">			${ context.itemName ? block2(context) : undefined }<span>${ifDefined(context.titleText)}</span></div><div class="ui5-tli-subtitle">${ifDefined(context.subtitleText)}</div>		${ context.textContent ? block5(context) : undefined }<span class="ui5-tli-bubble-arrow ui5-tli-bubble-arrow--left"></span></div></div>`; };
const block1 = (context) => { return html`<div class="ui5-tli-icon-outer"><ui5-icon class="ui5-tli-icon" name="${ifDefined(context.icon)}"></ui5-icon></div>		`; };
const block2 = (context) => { return html`${ context.itemNameClickable ? block3(context) : undefined }${ !context.itemNameClickable ? block4(context) : undefined }`; };
const block3 = (context) => { return html`<ui5-link @click="${context.onItemNamePress}">${ifDefined(context.itemName)}</ui5-link>	`; };
const block4 = (context) => { return html`<span>${ifDefined(context.itemName)}</span>	`; };
const block5 = (context) => { return html`<div class="ui5-tli-desc"><slot></slot></div>		`; };

export default block0;
